drop table if exists profile cascade ;
drop table if exists friend cascade ;
drop table if exists message cascade ;
drop table if exists agroup cascade ;
drop table if exists groupMember cascade ;

create table profile(
    userID integer,
    name varchar(50) not null,
    email varchar(50) unique,
    password varchar(50) not null,
    date_of_birth date not null ,
    lastlogin timestamp not null,
    constraint pk_profile primary key (userID)
);

create table friend(
    userID1 integer,
    userID2 integer,
    JDate date not null,
    message varchar(200) not null,
    constraint pk_friend primary key (userID1,userID2),
    constraint fk_friend_user1 foreign key (userID1) references profile (userID) deferrable,
    constraint fk_friend_user2 foreign key (userID2) references profile (userID) deferrable
);

create table message(
    msgID integer,
    fromID integer not null,
    message varchar(200) not null,
    toUserID integer default null,
    toGroupID integer default null,
    timeSent timestamp not null,
    constraint pk_message primary key (msgID),
    constraint fk_message_fromID foreign key (fromID) references profile (userID),
    constraint fk_message_toUserID foreign key (toUserID) references profile (userID)
);

create table agroup(
    gID integer,
    name varchar(50),
    alimit integer,
    description varchar(200),
    constraint pk_agroup primary key (gID)
);

create table groupMember(
    gID integer,
    userID integer,
    role varchar(20),
    constraint pk_groupMember primary key (gID, userID),
    constraint fk_groupMember_gID foreign key (gID) references agroup (gID),
    constraint fk_groupMember_userID foreign key (userID) references profile (userID)
);




select * from profile;
select * from friend;
select * from message;
select * from agroup;
select * from groupMember;

-- Test that all messages are between existing friends (just tests the current insertion, this is not generally true)
-- case 1: there are no friends (x,y) such that message.fromID = x and message.toUserID = y
-- case 2: there are no friends (y,x) such that message.fromID = y and message.toUserID = x
-- If both are true, then we have an error
select * from message m
where
    not exists(
        select * from friend f where f.userID1 = m.fromID and f.userID2 = m.toUserID
        )
    and
    not exists(
        select * from friend f where f.userID2 = m.fromID and f.userID1 = m.toUserID
        )
;

